import React, {Component} from 'react';
import PropTypes from 'prop-types';
import Blockies from 'react-blockies';
import Modal from 'react-modal';

const customStyles = {
  content : {
    top                   : '50%',
    left                  : '50%',
    right                 : 'auto',
    bottom                : 'auto',
    marginRight           : '-50%',
    transform             : 'translate(-50%, -50%)'
  }
};

Modal.setAppElement('#app');

class MainScreenView extends Component {

  constructor() {
    super();

    this.state = {
      modalIsOpen: false
    };

    this.openModal = this.openModal.bind(this);
    this.afterOpenModal = this.afterOpenModal.bind(this);
    this.closeModal = this.closeModal.bind(this);
  }

  openModal() {
    this.setState({modalIsOpen: true});
  }

  afterOpenModal() {
    this.subtitle.style.color = '#f00';
  }

  closeModal() {
    this.setState({modalIsOpen: false});
  }


  render() {

    const testImage = " data:image/jpeg;base64,";

    const name = "Francisco";
    const description = "Eu quero um homem que me trate com compaixão e paixão";

    return (
      <div className="main-screen">

        <div className="container text-center">
          <div className="row">
            <div className="col-4 text-center">
              <button onClick={this.props.goToProfile}>
                <i class="fas fa-1x fa-user"></i>
              </button>
            </div>
            <div className="col-4 text-center">
              <img src={require('../img/redlit.jpg')} height="25px" width="70px"/>
            </div>
            <div className="col-4 text-center">
              <button onClick={this.props.goToRelations}>
                <i class="fas fa-1x fa-comments"></i>
              </button>
            </div>
          </div>
          <div className="row text-center photos-section">
            <div className="col-12 text-center">
              <img src={testImage} height="400px" width="auto"/>
            </div>
          </div>
          <div className="row text-center">
            <div className="col-12 text-left profile-name">{this.props.name}</div>
          </div>
          <div className="row text-center">
            <div className="col-12 text-left profile-description">{this.props.description}</div>
          </div>
          <div className="row">
            <div className="col-6 text-center">
              <button onClick={this.props.rejectProfile}>
                <img src={require('../img/no.svg')}/>
              </button>
            </div>
            <div className="col-6 text-center">
              <button onClick={this.openModal}>
                <img src={require('../img/yes.svg')}/>
              </button>
            </div>
          </div>
        </div>
        <div>

        <Modal
          isOpen={this.state.modalIsOpen}
          onAfterOpen={this.afterOpenModal}
          onRequestClose={this.closeModal}
          style={customStyles}
          contentLabel="Example Modal"
        >
          <h2 ref={subtitle => this.subtitle = subtitle}>Spark</h2>
          <div className="row  text-center">
            <form>
              <input type="number" min="1" max="100" />
              <button onClick={this.openModal}><img src={require('../img/fire.png')} width=""/></button>
            </form>
          </div>
          <div className="row text-center">
            <button onClick={this.closeModal}>Back</button>
          </div>
        </Modal>
       </div>
      </div>
    );
  }
}

MainScreenView.propTypes = {
  events: PropTypes.array,
  goToProfile: PropTypes.func,
  rejectProfile: PropTypes.func,
  name: PropTypes.string,
  description: PropTypes.string
};

export default MainScreenView;
